import React from 'react';
import { View } from 'react-native';
import IngredientesScreen from './screens/IngredientesScreen';
import AbmIngredientesScreen from './screens/AbmIngredientesScreen';

const App = () => {
  return (
    <View style={{ flex: 1 }}>
      <IngredientesScreen />
      <AbmIngredientesScreen />
    </View>
  );
};

export default App;
